import meRing from "../..//Assets/meRing.png";
import { motion, useScroll } from "framer-motion";
import "./Hero.css";
const Hero = () => {
  const control = useAnimation();
  const [ref, inView] = useInView();

  return (
    <motion.div
      className="heroDiv"
      initial={{
        opacity: 0,
        x: 1000,
      }}
      animate={{
        opacity: 1,
        x: 0,
      }}
      onScroll={scrollYProgress}
    >
      <section className="hero">
        <img src={meRing} alt="myProfile-img" draggable="false" />
      </section>
    </motion.div>
  );
};
export default Hero;
